function Settings() {
  const perm1 = (category) => {
    return category === 'admin';
  };
  const perm2 = (category) => {
    return category === 'admin' || category === 'reviewer';
  };
  const perm3 = (category) => {
    return (
      category === 'admin' || category === 'reviewer' || category === 'operator'
    );
  };
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '50vh',
      }}
